import React from 'react';
import { FormControlLabel, Checkbox } from '@mui/material';

const DateCreated = ({ date, isSorted, onSortChange }) => {
  const handleCheckboxChange = (event) => {
    const isChecked = event.target.checked;
    onSortChange(isChecked, date);
  };

  const displayDate = date ? new Date(date) : null;

  return (
    <div>
      {displayDate 
          ? `${displayDate.getDate()}-${displayDate.getMonth() + 1}-${displayDate.getFullYear()}`
          : ''}
      <FormControlLabel
        control={
          <Checkbox
            checked={isSorted ?? false}
            onChange={handleCheckboxChange}
          />
        }
        label="Фильтр"
      />
    </div>
  );
};

export default DateCreated;
